import React, { Component } from 'react';

const ListGroup = (props) => {
  const { items } = props;
  return (
    <ul class="list-group">
      {items.map((item) => (
        <li key={item._id} class="list-group-item"></li>
      ))}
    </ul>
  );
};

export default ListGroup;
